import './App.css';

const topSongs = [
  {
    id: 1,
    name: 'Marea (we\'ve lost dancing)',
    viewer: '310,790,748',
    duration: '4:45',
  },
  {
    id: 2,
    name: 'Turn On The Lights again.. (feat. Future',
    viewer: '177,550,875',
    duration: '4:27',
  },
  {
    id: 3,
    name: 'Delilah (pull me out of this)',
    viewer: '151,616,610',
    duration: '4:10',
  },
  {
    id: 4,
    name: 'Rumble',
    viewer: '124,906,696',
    duration: '2:26',
  },
  {
    id: 5,
    name: 'Jungle',
    viewer: '124,244,633',
    duration: '3:18',
  }
]

const concerts = [
  {
    id: 1,
    location: 'Bonnaroo',
    date: 'June 16, 2024',
    city: 'Manchester',
  },
  {
    id: 2,
    location: 'Syd For Solen',
    date: 'August 8, 2024',
    city: 'Copenhagen',
  },
  {
    id: 3,
    location: 'Flow Festival',
    date: 'August 8, 2024',
    city: 'Helsinki',
  } 
]




function TopSongs() {
  const listSongs = topSongs.map(song =>
    <li key={song.id}>
      {song.name} - {song.viewer} - {song.duration}
    </li>
  );
  return (
    <div>
      <h2>Top Songs</h2>
      <ul>{listSongs}</ul>
    </div>
  )
}


function Concerts() {
  const listConcerts = concerts.map(concert =>
    <li key={concert.id}>
      {concert.date} - {concert.location} - {concert.city}
    </li>
  );
  return (
    <div>
      <h2>Upcoming Concerts</h2>
      <ul>{listConcerts}</ul>
    </div>
  )
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TopSongs/>
        <Concerts/>
      </header>
    </div>
  );
}

export default App;
